import { Component, ɵsetAllowDuplicateNgModuleIdsForTest } from '@angular/core';
import { HttpClient } from '@angular/common/http'
import { provideProtractorTestingSupport } from '@angular/platform-browser';

interface IPropertyListing {
  owner: string
  address: string
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public owner = ''
  public address = ''
  public propertyListing: IPropertyListing[] = []

  constructor(
    private httpClient: HttpClient
  ){}

  async loadProperties() {
    this.propertyListing = await this.httpClient.get<IPropertyListing[]>('/api/properties').toPromise()
  }

  async addProperty() {
    await this.httpClient.post('/api/properties', {
      owner: this.owner,
      address: this.address
     }).toPromise()

    this.owner = ''
    this.address = ''
  }
}
